def _get_time_bins(self, ax):
    if not isinstance(ax, DatetimeIndex):
        raise TypeError(
            "axis must be a DatetimeIndex, but got an instance of {type(ax).__name__}"
        )

    if len(ax) == 0:
        binner = labels = DatetimeIndex(data=[], freq=self.freq, name=ax.name)
        return binner, [], labels

    first = ax.min() - DateOffset(nanoseconds=1)  # Adjust for nanosecond at the beginning of the range
    last = ax.max()
    bin_range = date_range(start=first, end=last, freq=self.freq, closed=self.closed)

    ax_values = ax.asi8
    binner, bin_edges = self._adjust_bin_edges(bin_range, ax_values)

    bins = None
    if self.closed == "right":
        bins = bin_edges[1:]
    else:
        bins = bin_edges[:-1]

    labels = bin_range[:-1]  # Adjust labels based on the closed end

    return binner, bins, labels
